    required: false,
    default: false,
  },
  variant: {
    type: String,
    required: false,
  },
  type: {
    type: String,
    required: false,
    default: "button",
  },
  mode: {
    type: String,
    required: false,
  },
},
  setup(__props, { expose }) {
  expose();

const props = __props



const __returned__ = { props }
Object.defineProperty(__returned__, '__isScriptSetup', { enumerable: false, value: true })
